import {useRouter} from "next/router";

import About from 'styles/about';

export default () => {
    const router = useRouter();
    const show = router.pathname === '/about';

    return (
        <About>
            <section>
                <h1>
                    Passion. Cutting Edge Technologies. Interaction. Creativity. Performant Code. Modern Architecture.
                </h1>
                <p>
                    You deserve it all.
                </p>
            </section>
        </About>
    );
}
